import React from 'react';
import Container from 'react-bootstrap/Container';
import link from '../assets/images/link.svg';

function Footer(){

    return(
        <footer className="footer">
            <Container className="border-top justify-content-between" fluid={true}>
                  <Row>
                      <Col>
                   <p className="footer-span">Copyright &copy; Gaofeng.</p></Col>
                      <Col>
                   <a href="https://www.linkedin.com/in/gaofengyin/" target="_blank" rel="noopener noreferrer">
                <img className="link-footer" src={link} alt="img" /></a></Col>
                </Row>
            </Container>
        </footer>
    );

}

export default Footer;
